import './App.css';
import React, { Fragment } from 'react';
import Greeting from './components/Greeting';
function App() {
  return (
    <Fragment>
      <div className='App'>
        <Greeting header={'ismaeil'} statue={'i am good'} />
      </div>
    </Fragment>
  );
}

export default App;
